INSERT INTO `bln_pendahuluan` (`id`, `id_bulan`, `tahun`, `iduser`, `idusergroup`, `latar_belakang`, `tujuan_laporan`, `kejadian_penting`, `periode`, `keterangan`, `direksi`, `file`, `status`, `nama_penandatangan`, `jabatan`, `status_tgl`, `insert_at`, `update_at`, `id_ref`) VALUES
	(2, '10', 2021, 'TSN002', NULL, '<p>PT TASPEN (Persero) mengelola Program Asuransi Sosial yang terdiri dari Program Tabungan Hari Tua, Program Pensiun, Program Jaminan Kecelakaan Kerja (JKK), dan Program Jaminan Kematian (JKM).</p>\r\n\r\n<p>Penyelenggaraan pembayaran pensiun dilakukan berdasarkan Undang-Undang Nomor 11 tahun 1969 tentang Pensiun Pegawai dan Pensiun Janda/Duda Pegawai. Dalam ketentuan pasal 2 Undang-Undang Tahun 1969 tersebut antara lain disebutkan bahwa sambil menunggu terbentuknya Dana Pensiun sesuai amanat UU tersebut, maka untuk sementara sumber dana pembayaran pensiun berasal dari Anggaran Pendapatan dan Belanja Negara (APBN) <em>(pay as you go</em>). Pelaksanaan pembayaran pensiun pada awalnya dibayarkan melalui KPKN/Kas Negara.</p>\r\n\r\n<p>Berdasarkan Keputusan Presiden Nomor 56 Tahun 1974 tentang Pembagian, Penggunaan, Cara Pemotongan, Penyetoran, dan Besarnya Iuran-iuran yang Dipungut dari Pegawai Negeri Sipil, Pejabat Negara, dan Penerima Pensiun,&nbsp; pemotongan iuran&nbsp; Pegawai Negeri Sipil dan Pejabat Negara adalah 3,25% untuk program THT dan 4,75% untuk program pensiun. Untuk program THT pengelolaannya diserahkan kepada PT TASPEN (Persero) dan untuk pensiun disimpan pada bank pemerintah.</p>\r\n\r\n<ol>\r\n	<li><strong>Program Pensiun P</strong><strong>egawai Negeri Sipil (P</strong><strong>NS</strong><strong>)</strong><strong>.</strong></li>\r\n</ol>\r\n\r\n<p>Pensiun adalah penghasilan yang diterima oleh penerima pensiun setiap bulan sebagai jaminan hari tua dan penghargaan atas jasa-jasa Pegawai Negeri selama bertahun-tahun bekerja dalam dinas Pemerintah.</p>\r\n\r\n<p>Dalam rangka melaksanakan PP Nomor 25 tahun 1981 dan PP Nomor 26 tahun 1981, Menteri Keuangan :</p>\r\n\r\n<ol>\r\n	<li>Menerbitkan surat dengan Nomor S-244/MK.011/1985 tanggal 21 Februari 1985 juncto Nomor S-199/MK.11/1985 tanggal 10 April 1985 perihal penempatan Dana Pensiun PNS pada PT TASPEN (Persero). Di dalam surat tersebut dinyatakan bahwa Dana Pensiun PNS yang semula ditempatkan pada Bank-Bank Pemerintah dialihkan kepada<br />\r\n	PT TASPEN (Persero).</li>\r\n</ol>\r\n\r\n<p>Dengan ditetapkannya Peraturan Pemerintah Nomor 25 tahun 1981 dan Peraturan Pemerintah Nomor 26 tahun 1981, maka ketentuan mengenai iuran THT dan Pensiun Pegawai Negeri Sipil serta badan hukum pengelolanya sebagaimana dimaksud dalam Keputusan Presiden Nomor 56 tahun 1974 yang telah diubah dengan Keputusan Presiden Nomor 8 tahun 1977 dianggap tidak lagi relevan, karena materi yang ada dalam Keppres tersebut telah diatur dalam Peraturan Pemerintah tersebut.</p>\r\n\r\n<ol start="2">\r\n	<li>Mengalihkan pembayaran pensiun yang semula dilakukan melalui Kantor Kas Negara Departemen Keuangan kepada PT TASPEN (Persero) secara bertahap mulai tahun 1987 sebagai berikut :</li>\r\n</ol>\r\n\r\n<p>Tahap Pertama :</p>\r\n\r\n<p>Berdasarkan Surat Keputusan Menteri Keuangan Nomor 822/KMK.03/1986 tanggal<br />\r\n22 Desember 1986 dan Keputusan Menteri Dalam Negeri Nomor 842.1841 tanggal<br />\r\n13 Oktober 1986, PT TASPEN (Persero) melakukan pembayaran pensiun di wilayah Bali, NTB dan NTT yang dimulai sejak tanggal 1 Januari 1987.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tahap Kedua :</p>\r\n\r\n<p>Berdasarkan Surat Keputusan Menteri Keuangan Nomor 702/KMK.03/1987 tanggal 31 Oktober 1987 dan Keputusan Menteri Dalam Negeri Nomor 842.1-1402 tanggal 14 November 1987, PT TASPEN (Persero) melakukan pembayaran pensiun di wilayah Sumatera yang dimulai sejak tanggal 1 Januari 1988.</p>\r\n\r\n<p>Tahap Ketiga :</p>\r\n\r\n<p>Berdasarkan Surat Keputusan Menteri Keuangan Nomor 812/KMK.03/1988 tanggal&nbsp;&nbsp;23 Agustus 1988 dan Keputusan Menteri Dalam Negeri Nomor 842.1-755 tanggal&nbsp;27 Desember 1988, PT TASPEN (Persero) melakukan pembayaran pensiun di wilayah Jawa dan Madura yang dimulai sejak tanggal 1 Januari 1989.</p>\r\n\r\n<p>Tahap Keempat :</p>\r\n\r\n<p>Berdasarkan Surat Keputusan Menteri Nomor 79/KMK.03/1990 tanggal 22 Januari 1990 dan Surat Keputusan Menteri Dalam Negeri Nomor 842.1-099 tanggal 12 Februari 1990, PT TASPEN (Persero) melakukan pembayaran pensiun di wilayah Kalimantan, Sulawesi, Maluku, Irian Jaya dan Timor Timur yang dimulai sejak tanggal 1 April 1990.</p>\r\n\r\n<p>Kebijakan Pemerintah atas penugasan pengelolaan Akumulasi Iuran Pensiun yaitu :</p>\r\n\r\n<ol>\r\n	<li>Keputusan Menteri Keuangan Nomor: 511/KMK.06/2002 Tentang Investasi Dana Pensiun yang telah mengalami perubahan dengan Peraturan Menteri Keuangan Republik Indonesia Nomor: 52/PMK.02/2021 Tentang Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil, Pejabat Negara, Prajurit Tentara Nasional Indonesia, dan Anggota Kepolisian Negara Republik Indonesia.</li>\r\n</ol>\r\n\r\n<ol start="2">\r\n	<li>Peraturan Menteri Keuangan Nomor: 20/PMK.01/2007 tentang Pengadministrasian, Pelaporan dan Pengawasan Penitipan Dana Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara dan Peraturan pelaksanaannya melalui Peraturan Ketua Bapepam-LK Nomor: PER-02/BL/2007 terakhir diubah menjadi Peraturan Menteri Keuangan Republik Indonesia Nomor: 169/PMK.02/2019 Tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil &amp; Pejabat Negara.</li>\r\n</ol>\r\n\r\n<ol start="3">\r\n	<li>Peraturan Pemerintah Republik Indonesia Nomor 20 Tahun 2013 Tentang Perubahan atas Peraturan Pemerintah Nomor 25 Tahun 1981 Tentang Asuransi Sosial Pegawai Negeri Sipil.</li>\r\n</ol>\r\n\r\n<ol start="4">\r\n	<li>Surat Menteri Keuangan Nomor: S-1517/MK.013/1987 Perihal Biaya Penyelenggaraan Pensiun Dari Dana Pensiun terakhir diubah menjadi Peraturan Menteri Keuangan Nomor: 39/PMK.02/2021 tentang Biaya Operasional Penyelenggaraan Pembayaran Manfaat Pensiun Yang Dilaksanakan Oleh PT TASPEN (PERSERO) dan PT ASABRI (PERSERO).</li>\r\n</ol>\r\n\r\n<p>Sesuai dengan Peraturan Menteri Keuangan Republik Indonesia Nomor 169/PMK.02/2019 tanggal 21 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil &amp; Pejabat Negara bagian kedua tentang Tata Cara Penyampaian Laporan, pasal 8 ayat (1) Laporan bulanan sebagaimana dimaksud dalam Pasal 4 ayat (2)<br />\r\nhuruf c disampaikan kepada Menteri Keuangan cq Direktur Jenderal Anggaran.</p>\r\n', '<p><span style="font-size:11.0pt"><span style="font-family:&quot;Cambria&quot;,serif">Menteri Keuangan cq Direktur Jenderal Anggaran</span></span></p>\r\n', '<p>-</p>\r\n', '<p>30 November 2021</p>\r\n', '<p>1. Bertanggung jawab atas penyusunan dan penyajian laporan bulanan pengelolaan Akumulasi Iuran Pensiun ASN dan Pejabat Negara;<br />\r\n2. Laporan keuangan laporan bulanan pengelolaan Akumulasi Iuran Pensiun ASN dan Pejabat Negara telah disusun dan disajikan sesuai dengan ketentuan yang berlaku;<br />\r\n3. Semua informasi dalam laporan-laporan bulanan pengelolaan Akumulasi Iuran Pensiun ASN dan Pejabat Negara telah dimuat secara lengkap dan benar.<br />\r\n&nbsp;</p>\r\n', '<p>Nama : A.N.S. Kosasih<br />\r\nJabatan : Direktur Utama</p>\r\n', '', NULL, NULL, NULL, NULL, '2021-12-15 09:55:48', NULL, NULL),
