INSERT INTO `tb_pendahuluan_semesteran` (`id`, `idusergroup`, `iduser`, `semester`, `tahun`, `tujuan_laporan`, `latar_belakang`, `kejadian_penting`, `periode`, `keterangan`, `direksi`, `komisaris`, `alamat`, `file`, `status`, `nama_penandatangan`, `jabatan`, `status_tgl`, `insert_at`, `update_at`, `id_ref`) VALUES
	(1, '', 'TSN002', '2', 2022, '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span><span style="font-size:10.0pt">Semester II Tahun 2022 </span><span style="font-size:10.0pt">ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan </span><span style="font-size:10.0pt">pasal 8) </span><span style="font-size:10.0pt">Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor : 243/PMK.02/2016 tanggal 30 Desember 2016</span><span style="font-size:10.0pt">.</span></span></p>\r\n', '<p><span style="font-size:10.0pt">Guna memenuhi kewajiban sebagai Badan Penyelenggara Dana Iuran Pegawai Negeri Sipil dan Pejabat Negara, maka PT T</span><span style="font-size:10.0pt">ASPEN</span><span style="font-size:10.0pt"> (Persero) diwajibkan untuk menyampaikan Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara </span><span style="font-size:10.0pt">Semester II Tahun 2022</span><span style="font-size:10.0pt"> dalam rangka pengawasan atas pengadministrasian penitipan dana yang berasal dari iuran pensiun Pegawai Negeri Sipil dan Pejabat Negara.</span></p>\r\n', '<p style="margin-left:0.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Beberapa kejadian dan kegiatan penting pada </span><span style="font-size:10.0pt">Semester II Tahun 2022 </span><span style="font-size:10.0pt">adalah sebagai berikut</span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="text-align:justify"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Pertumbuhan </span></strong><strong><span style="font-size:10.0pt">Total Aset dan Kewajiban Akumulasi Iuran Pensiun PNS dan &nbsp;&nbsp;Pejabat Negara</span></strong></span>\r\n\r\n		<ol style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Sampai dengan Semester II Tahun 2022, Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara sebesar Rp206.165.992.488.745,- Jika dibandingkan dengan kondisi per Semester I Tahun 2022 mengalami &nbsp;pertumbuhan sebesar Rp12.358.677.315.793,- atau naik 6,38%.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Aset tersebut terdiri dari:</span></span></p>\r\n\r\n<ul>\r\n	<li style="list-style-type:none">\r\n	<ul>\r\n		<li style="list-style-type:none">\r\n		<ul>\r\n			<li style="list-style-type:none">\r\n			<ul style="list-style-type:disc">\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Aset Investasi sebesar Rp195.513.980.649.785,- meningkat sebesar Rp4.206.963.423.076,- atau naik sebesar 2,20% bila dibandingkan dengan Semester I Tahun 2022; </span></span></li>\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Aset Bukan Investasi sebesar Rp10.652.011.838.960,- mengalami peningkatan sebesar Rp8.151.713.892.717,- atau naik 326,03% bila &nbsp;dibandingkan dengan Semester I Tahun 2022.</span></span></li>\r\n			</ul>\r\n			</li>\r\n			<li><span style="font-size:14pt"><span style="font-size:10.0pt">Total Kewajiban dan &nbsp;Dana Bersih</span></span></li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada Semester II Tahun 2022 sebesar Rp327.549.629.472,- atau mengalami peningkatan sebesar Rp22.697.774.794,- atau naik 7,45% jika dibandingkan dengan Semester I Tahun 2022.</span></span></p>\r\n\r\n<p><span style="font-size:10.0pt">Sedangkan Pencapaian Total Dana Bersih yang merupakan selisih dari Total Aset dan Total Kewajiban pada Semester II Tahun 2022 adalah sebesar Rp205.838.442.859.273,- atau naik sebesar Rp12.335.979.540.999,- atau mengalami pertumbuhan sebesar 6,38%</span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="text-align:justify"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Pertumbuhan </span></strong><strong><span style="font-size:10.0pt">Total Aset dan Kewajiban Akumulasi Iuran Pensiun PNS dan &nbsp;&nbsp;Pejabat Negara</span></strong></span>\r\n\r\n		<ol style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Sampai dengan Semester II Tahun 2022, Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara sebesar Rp206.165.992.488.745,- Jika dibandingkan dengan kondisi per Semester I Tahun 2022 mengalami &nbsp;pertumbuhan sebesar Rp12.358.677.315.793,- atau naik 6,38%.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Aset tersebut terdiri dari:</span></span></p>\r\n\r\n<ul>\r\n	<li style="list-style-type:none">\r\n	<ul>\r\n		<li style="list-style-type:none">\r\n		<ul>\r\n			<li style="list-style-type:none">\r\n			<ul style="list-style-type:disc">\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Aset Investasi sebesar Rp195.513.980.649.785,- meningkat sebesar Rp4.206.963.423.076,- atau naik sebesar 2,20% bila dibandingkan dengan Semester I Tahun 2022; </span></span></li>\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Aset Bukan Investasi sebesar Rp10.652.011.838.960,- mengalami peningkatan sebesar Rp8.151.713.892.717,- atau naik 326,03% bila &nbsp;dibandingkan dengan Semester I Tahun 2022.</span></span></li>\r\n			</ul>\r\n			</li>\r\n			<li><span style="font-size:14pt"><span style="font-size:10.0pt">Total Kewajiban dan &nbsp;Dana Bersih</span></span></li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">Total Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada Semester II Tahun 2022 sebesar Rp327.549.629.472,- atau mengalami peningkatan sebesar Rp22.697.774.794,- atau naik 7,45% jika dibandingkan dengan Semester I Tahun 2022.</span></span></p>\r\n\r\n<p><span style="font-size:10.0pt">Sedangkan Pencapaian Total Dana Bersih yang merupakan selisih dari Total Aset dan Total Kewajiban pada Semester II Tahun 2022 adalah sebesar Rp205.838.442.859.273,- atau naik sebesar Rp12.335.979.540.999,- atau mengalami pertumbuhan sebesar 6,38%.</span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li><span style="font-size:14pt"><span style="font-size:10.0pt">P</span><strong><span style="font-size:10.0pt">eningkatan Pelayanan</span></strong></span>\r\n\r\n		<ol style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Upaya yang Telah dan Sedang Dilakukan untuk Meningkatkan Kualitas Pelayanan</span></strong></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Upaya-upaya yang telah dan sedang dilakukan guna meningkatkan kualitas dan perluasan pelayanan kepada peserta adalah dengan pengembangan <em>Delighted Customer Services </em>(DCS) dalam bentuk <em>high quality services</em> diantaranya melalui Layanan Klaim Otomatis, <em>E-Channel Delivery Services</em> dan TASPEN PESONA &ldquo;Tanggap Andal Selamatkan Pensiunan dengan Pelayanan Bebas Corona&rdquo; melalui layanan <em>e-klaim</em> TASPEN, TASPEN <em>Care</em>, dan aplikasi TASPEN Otentikasi.</span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="list-style-type:none">\r\n		<ol start="2" style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Sosialisasi KeTASPENan</span></strong></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Sosialisasi dilakukan melalui berbagai media, yaitu media cetak dan media online. Saat ini TASPEN juga memaksimalkan penggunaan media sosial dalam melakukan sosialisasi dan publikasi KETASPENAN.</span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="list-style-type:none">\r\n		<ol style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:14pt"><strong><em><span style="font-size:10.0pt">Press Release</span></em></strong></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Pelaksanaan <em>Press Release</em> yang dilaksanakan sampai dengan Semester II Tahun 2022 diantaranya sebagai berikut:</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Raih Penghargaan <em>Corporate Reputation Awards</em> 2022 <em>in Mandatory Insurance Category</em></span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Raih 3 Penghargaan <em>Human Capital on Resilience Award</em> 2022</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Raih Penghargaan T<em>he Best Sustainable Development Goals Program Implementation</em> 2022 Dalam Ajang Indonesia CSR <em>Award-V</em> 2022</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Persembahkan Kado HUT ke-77 RI ke Masyarakat melalui Program Relawan Bakti BUMN</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Program TJSL TASPEN - TASPEN Bantu Tingkatkan Kualitas Pendidikan di Kabupaten Bandung Melalui Program Srikandi Mengajar</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Program TASPENPreneur - TASPEN Siap Tingkatkan Produktivitas UMKM <em>Go Online Go Digital</em></span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Komitmen TASPEN Terapkan <em>Good Corporate Governance</em> Dalam Pengelolaan Investasi dan Operasional Perusahaan</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Taspen Aktif Layani 6,81 Juta Peserta di Indonesia</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN dan Bank Kalsel Siap Salurkan Dana Pensiun ASN</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Serahkan Manfaat Program THT dan Pensiun Mantan Menteri Agraria dan Tata Ruang RI</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Tingkatkan Kualitas Layanan, TASPEN Lakukan Evaluasi Mitra Bayar di Seluruh Indonesia</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Direktur Utama TASPEN Raih Penghargaan Tokoh Transformasi Layanan untuk Kesejahteraan Pensiunan dalam Rakyat Merdeka <em>Award</em> 2022</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Penandatanganan Nota Kesepahaman TASPEN dan PPATK, Sosialisasi Penerapan Anti Pencucian Uang </span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN raih 3 Penghargaan di Indonesia <em>Digital Innovation and Achievement Awards</em> 2022 untuk kategori <em>Best Digital Innovation In Financial Services</em> 2022, <em>Best Chief Executive Officer</em> (CEO) Indonesia <em>Digital Innovation and Achievement of The Year</em> 2022 atas nama Direktur Utama TASPEN A.N.S Kosasih dan <em>Best Chief Technology Officer</em> (CTO) <em>Indonesia Digital Innovation and Achievement of The Year</em> 2022 atas nama Direktur SDM dan TI TASPEN Ovita Susiana Rosya.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN, Pemkot Surakarta dan Bank Jateng kerjasama dalam penyediaan rumah untuk ASN.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Penandatanganan Perjanjian Kerjasama (PKS) TASPEN dan Bank MNC Internasional sebgai Mitra Bayar Digital Pembayaran Manfaat kepada Seluruh Peserta TASPEN.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN salurkan bantuan ke korban bencana gempa bumi di Cianjur</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; BUMN terus berkomitmen dalam penyelamatan dan pelestarian arsip, TASPEN terima penghargaan dari ANRI. </span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Pesona (Tanggap Andal Selamatkan Pensiunan Dengan Pelayanan Bebas Corona) raih Penghargaan TOP 45 Inovasi Layanan Publik dari KEMENPAN-RB.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; Peringatkan Hari Anti Korupsi, TASPEN dan KPK Tingkatkan Sistem Anti Penyuapan kepada seluruh Rekan Bisnis TASPEN.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN kembali Raih Penghargaan Badan Publik Informatif Tahun 2022 yang diselenggarakan oleh Komisi Informasi Pusat (KIP).</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN akan tingkatkan Layanan <em>Call Center</em> di Tahun 2023.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN harap TOOS bisa memudahkan proses klaim Peserta, dengan mengintegrasikan layanan dari <em>Taspen Care</em> (TCare) ke <em>Taspen One Hour Online Services</em> (TOOS).</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN wakili Indonesia Sebagai Ketua Asosiasi Penyelenggara Jaminan Sosial Bagi ASN Pertama di Asia.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">&bull;&nbsp;&nbsp;&nbsp; TASPEN Kembali Raih Penghargaan Perusahaan Terpercaya dalam Indonesia <em>Good Corporate Governance Award</em> 2022.</span></span></p>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify">&nbsp;</p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="list-style-type:none">\r\n		<ol start="2" style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Peningkatan Validasi dan Akurasi Data</span></strong></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:1.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Dalam rangka meningkatkan <em>competitive advantage</em> guna optimalisasi manajemen data peserta, PT TASPEN (Persero) melakukan upaya-upaya sebagai berikut :</span></span></p>\r\n\r\n<ol>\r\n	<li style="text-align:justify"><span style="font-size:10.0pt">Rekonsiliasi data peserta aktif dan penerimaan iuran</span><span style="font-size:10.0pt"> dilakukan setiap bulan (Internal Pra Rekonsiliasi), Rekonsiliasi dengan instansi peserta dilakukan minimal 1 kali dalam satu tahun</span><span style="font-size:10.0pt">. Validasi Data Peserta Aktif </span><span style="font-size:10.0pt">periode </span><span style="font-size:10.0pt">31 Desember 2022 mencapai 99,77%.</span></li>\r\n	<li style="text-align:justify"><span style="font-size:10.0pt">&nbsp;&nbsp;Validasi Data Pensiun sampai dengan </span><span style="font-size:10.0pt">31 Desember 2022 mencapai 100%.</span></li>\r\n</ol>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Laporan </span><span style="font-size:10.0pt">Semester II Tahun 2022 </span><span style="font-size:10.0pt">Akumulasi Iuran Pensiun PNS dan Pejabat Negara ini merupakan informasi mengenai PT T</span><span style="font-size:10.0pt">ASPEN</span><span style="font-size:10.0pt"> (Persero) dan penjabaran laporan kegiatan yang memuat aspek-aspek operasional, keuangan, investasi </span><span style="font-size:10.0pt">dan operasional pembayaran belanja pensiun Anggaran Pendapatan dan Belanja Negara (APBN) periode 01 Juli 2022 sampai dengan 31 Desember 2022.</span></span></p>\r\n', '<p><span style="font-size:10.0pt">Dengan terbitnya laporan ini, dinyatakan bahwa isi Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara </span><span style="font-size:10.0pt">Semester II Tahun 2022 </span><span style="font-size:10.0pt">ini merupakan tanggung jawab PT TASPEN (Persero) selaku </span><span style="font-size:10.0pt">Pengelola </span><span style="font-size:10.0pt">Dana </span><span style="font-size:10.0pt">Akumulasi I</span><span style="font-size:10.0pt">uran </span><span style="font-size:10.0pt">P</span><span style="font-size:10.0pt">ensiun Pegawai Negeri Sipil dan Pejabat Negara</span></p>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Berdasarkan Surat Kementerian BUMN nomor: SK-23/MBU/01/2020 perihal Pemberhentian, Pengalihan Tugas, dan Pengangkatan Anggota-Anggota Direksi Perusahaan Perseroan (Persero) PT Dana Tabungan dan Asuransi Pegawai Negeri, Surat Kementerian BUMN nomor: SK-37/MBU/01/2020 perihal pengangkatan Anggota Direksi Perusahaan Perseroan (Persero) PT Dana Tabungan dan Asuransi Pegawai Negeri, Surat Kementerian BUMN nomor: SK-217/MBU/06/2021 tentang Perubahan Nomenklatur Jabatan, Pengalihan Tugas, dan Pengangkatan Anggota-Anggota Direksi Perusahaan Perseroran (Persero) PT Dana Tabungan dan Asuransi Pegawai Negeri, dan Surat Kementerian BUMN nomor: SK-27/MBU/01/2022 perihal Pemberhentian, Pengalihan Tugas, dan Pengangkatan Anggota-Anggota Direksi Perusahaan Perseroan (Persero) PT Dana Tabungan dan Asuransi Pegawai Negeri, maka susunan anggota Direksi PT TASPEN (Persero) sebagai berikut:</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify">&nbsp;</p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur Utama&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style="font-size:10.0pt">: </span><span style="font-size:10.0pt">A.N.S. Kosasih</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur Operasional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span> <span style="font-size:10.0pt">Ariyandi</span> </span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur </span><span style="font-size:10.0pt">Keuangan</span><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span> <span style="font-size:10.0pt">Rena Latsmi Puri</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur Perencanaan dan Aktuaria&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span> <span style="font-size:10.0pt">Feb Sumandar</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur Investasi&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Rony Hanityo Aprianto</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Direktur SDM dan Teknologi Informasi&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&