p;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span><span style="font-size:10.0pt"> Bima Haria Wibisana</span></span></p>\r\n', '<p style="margin-left:0.25in; margin-right:0in"><span style="font-size:14pt"><span style="font-size:10.0pt">Kantor Pusat PT TASPEN (Persero) berkedudukan di Jl. Letjen Suprapto No. 45 Cempaka Putih - Jakarta Pusat 10520 Telp. (021) 4241808 Fax. (021) 4203809.</span></span></p>\r\n', '', NULL, NULL, NULL, NULL, '2023-02-21 11:32:36', '0000-00-00 00:00:00', NULL),
