	(5, '', 'TSN002', '1', 2022, '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span><span style="font-size:10.0pt">Semester I Tahun 2022 </span><span style="font-size:10.0pt">ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan </span><span style="font-size:10.0pt">pasal 8) </span><span style="font-size:10.0pt">Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor: 243/PMK.02/2016 tanggal 30 Desember 2016</span><span style="font-size:10.0pt">.</span></span></p>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Guna memenuhi kewajiban sebagai Badan Penyelenggara Dana Iuran Pegawai Negeri Sipil dan Pejabat Negara, maka PT T</span><span style="font-size:10.0pt">ASPEN (Persero) diwajibkan untuk menyampaikan Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara dalam rangka pengawasan atas pengadministrasian penitipan dana yang berasal dari iuran pensiun Pegawai Negeri Sipil dan Pejabat Negara.</span></span></p>\r\n', '<p style="margin-left:0.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Beberapa kejadian dan kegiatan penting pada </span><span style="font-size:10.0pt">Semester I Tahun 2022 </span><span style="font-size:10.0pt">adalah sebagai berikut: </span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">1. Pertumbuhan </span></strong><strong><span style="font-size:10.0pt">Total Aset dan Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara</span></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp; a. Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span></li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sampai dengan Semester I Tahun 2022, Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara sebesar Rp193.807.315.172.952,- Jika </span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dibandingkan dengan kondisi per Semester II Tahun 2021 mengalami &nbsp;pertumbuhan sebesar Rp3.974.974.379.235,- atau naik 2,09%.</span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Aset tersebut terdiri dari:</span></span></p>\r\n\r\n<ul>\r\n	<li style="list-style-type:none">&nbsp;-<span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp; Aset Investasi sebesar Rp191.307.017.226.709,- meningkat sebesar Rp11.284.288.852.966,- atau naik sebesar 6,27% bila dibandingkan </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp; dengan Semester II Tahun 2021; </span></span></li>\r\n</ul>\r\n\r\n<ul>\r\n	<li style="list-style-type:none">- <span style="font-size:11pt"><span style="font-size:10.0pt">Aset Bukan Investasi sebesar Rp2.500.297.946.243,- mengalami penurunan sebesar Rp7.309.314.473.731,- atau turun 74,51% bila &nbsp;dibandingkan dengan Semester II Tahun 2021.</span></span></li>\r\n	<li style="list-style-type:none">b. <span style="font-size:14pt"><span style="font-size:10.0pt">Total Kewajiban dan &nbsp;Dana Bersih</span></span></li>\r\n	<li style="list-style-type:none">\r\n	<p style="margin-left:0in; margin-right:0in; text-align:justify">&nbsp;&nbsp; <span style="font-size:11pt"><span style="font-size:10.0pt">Total Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada Semester I Tahun 2022 sebesar Rp304.851.854.678,- atau&nbsp; </span></span></p>\r\n	</li>\r\n	<li style="list-style-type:none">\r\n	<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-size:10.0pt">&nbsp;&nbsp; mengalami peningkatan sebesar Rp112.028.892.207,- atau naik 58,10% jika dibandingkan dengan Semester II Tahun 2021.</span></span></p>\r\n	</li>\r\n	<li style="list-style-type:none"><span style="font-size:10.0pt">c. Sedangkan Pencapaian Total Dana Bersih yang merupakan selisih dari Total Aset dan Total Kewajiban pada Semester I Tahun 2022 adalah </span></li>\r\n	<li style="list-style-type:none"><span style="font-size:10.0pt">&nbsp;&nbsp; sebesar Rp193.502.463.318.274,- atau naik sebesar Rp3.862.945.487.028,- atau mengalami pertumbuhan sebesar 2,04%. </span></li>\r\n	<li style="list-style-type:none">2.&nbsp;<span style="font-size:14pt"> <strong><span style="font-size:10.0pt">Peningkatan Pelayanan</span></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><strong><span style="font-size:10.0pt">&nbsp;&nbsp; a. Upaya yang Telah dan Sedang Dilakukan untuk Meningkatkan Kualitas Pelayanan</span></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Upaya-upaya yang telah dan sedang dilakukan guna meningkatkan kualitas dan perluasan pelayanan kepada peserta adalah dengan&nbsp;&nbsp; </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; pengembangan <em>Delighted Customer Services </em>(DCS) dalam bentuk <em>high quality services</em> diantaranya melalui Layanan Klaim Otomatis, </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt"><em>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E-Channel Delivery Services</em> dan TASPEN PESONA &ldquo;Tanggap Andal Selamatkan Pensiunan dengan Pelayanan Bebas Corona&rdquo; melalui </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; layanan <em>e-klaim</em> TASPEN, TASPEN <em>Care</em>, dan aplikasi TASPEN Otentikasi.</span></span></li>\r\n	<li style="list-style-type:none">&nbsp;&nbsp;&nbsp; b. <span style="font-size:14pt"><strong><span style="font-size:10.0pt">Sosialisasi KeTASPENan</span></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Sosialisasi dilakukan melalui berbagai media, yaitu media cetak dan media online. Saat ini TASPEN juga memaksimalkan penggunaan </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; media sosial dalam melakukan sosialisasi, diantaranya sosialisasi TASPEN PESONA, TASPEN Mobile, TASPEN otentikasi dan lainnya.</span></span></li>\r\n	<li style="list-style-type:none">&nbsp;&nbsp; c. <span style="font-size:14pt"><strong><em><span style="font-size:10.0pt">Press Release</span></em></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Pelaksanaan <em>Press Release</em> yang dilaksanakan sampai dengan Semester I Tahun 2022 diantaranya sebagai berikut:</span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &bull;&nbsp;&nbsp;&nbsp; HUT TASPEN Ke-59</span></span></li>\