<li style="list-style-type:none">d. <span style="font-size:14pt"><strong><span style="font-size:10.0pt">Peningkatan Validasi dan Akurasi Data</span></strong></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp; Dalam rangka meningkatkan <em>competitive advantage</em> guna optimalisasi manajemen data peserta, PT TASPEN (Persero) melakukan upaya-&nbsp; </span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-size:10.0pt">&nbsp;&nbsp; upaya sebagai berikut :</span></span></li>\r\n	<li style="text-align:justify"><span style="font-size:10.0pt">&nbsp; &bull; </span><span style="font-size:12pt"><span style="font-size:10.0pt">Rekonsiliasi data peserta aktif dan penerimaan iuran</span><span style="font-size:10.0pt"> dilakukan setiap bulan (Internal Pra Rekonsiliasi), Rekonsiliasi dengan instansi&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>&nbsp; <span style="font-size:12pt"><span style="font-size:10.0pt">peserta dilakukan minimal 1 kali dalam satu tahun</span><span style="font-size:10.0pt">. Validasi Data Peserta Aktif </span><span style="font-size:10.0pt">periode </span><span style="font-size:10.0pt">30 Juni 2022 mencapai 98,69%</span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:12pt"><span style="font-size:10.0pt">&nbsp;&nbsp; </span></span><span style="font-size:10.0pt">&bull; </span><span style="font-size:12pt"><span style="font-size:10.0pt">Validasi Data Pensiun sampai dengan </span><span style="font-size:10.0pt">30 Juni 2022 mencapai </span><span style="font-size:10.0pt">9</span><span style="font-size:10.0pt">8</span><span style="font-size:10.0pt">,</span><span style="font-size:10.0pt">81%.</span></span></li>\r\n	<li style="list-style-type:none"><span style="font-size:12pt"><span style="font-size:10.0pt">&nbsp;&nbsp; </span></span><span style="font-size:10.0pt">&bull; </span><span style="font-size:12pt"><span style="font-size:10.0pt">Akurasi Data PNS Pusat dan PNS Daerah sampai dengan </span><span style="font-size:10.0pt">30 Juni 2022 </span><span style="font-size:10.0pt">mencapai </span><span style="font-size:10.0pt">100</span><span style="font-size:10.0pt">%</span></span></li>\r\n</ol>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Laporan </span><span style="font-size:10.0pt">Semester I Tahun 2022 </span><span style="font-size:10.0pt">Akumulasi Iuran Pensiun PNS dan Pejabat Negara ini merupakan laporan kegiatan yang memuat aspek-aspek operasional, keuangan, investasi </span><span style="font-size:10.0pt">dan operasional pembayaran belanja pensiun Anggaran Pendapatan dan Belanja Negara (APBN) periode 01 Januari 2022 sampai dengan 30 Juni 2022 yang dilaksanakan oleh PT TASPEN (Persero).</span></span></p>\r\n', '<p><span style="font-size:14pt"><strong><span style="font-size:10.0pt">Pernyataan Isi Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara Menjadi Tanggung Jawab PT</span></strong></span><span style="font-size:14pt"><strong><span style="font-size:10.0pt"> TASPEN (Persero)</span></strong></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-size:10.0pt">Dengan terbitnya laporan ini, dinyatakan bahwa isi Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara </span><span style="font-size:10.0pt">Semester I Tahun 2022 </span><span style="font-size:10.0pt">ini merupakan tanggung jawab PT TASPEN (Persero) selaku </span><span style="font-size:10.0pt">Pengelola </span><span style="font-size:10.0pt">Dana </span><span style="font-size:10.0pt">Akumulasi I</span><span style="font-size:10.0pt">uran </span><span style="font-size:10.0pt">P</span><span style="font-size:10.0pt">ensiun Pegawai Negeri Sipil dan Pejabat Nega</span></span></p>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span st