INSERT INTO `tb_pendahuluan_tahunan` (`id`, `iduser`, `tahun`, `tujuan_laporan`, `latar_belakang`, `kejadian_penting`, `periode`, `keterangan`, `direksi`, `komisaris`, `alamat`, `file`, `status`, `nama_penandatangan`, `jabatan`, `status_tgl`, `insert_at`, `update_at`, `id_ref`) VALUES
	(1, 'TSN002', 2022, '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Tahun 2021 (<em>Audited)</em> </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">pasal 8 </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor : 243/PMK.02/2016 tanggal 30 Desember 2016.Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Tahun 2021 (<em>Audited)</em> </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">pasal 8 </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor : 243/PMK.02/2016 tanggal 30 Desember 2016</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">.</span></span></span></span></p>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Guna memenuhi kewajiban sebagai Badan Penyelenggara Dana Iuran Pegawai Negeri Sipil dan Pejabat Negara, maka PT T</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">ASPEN</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif"> (Persero) diwajibkan untuk menyampaikan Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Tahun 2021</span></span> <em><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">(Audited)</span></span></em> <span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">dalam rangka pengawasan atas pengadministrasian penitipan dana yang berasal dari iuran pensiun Pegawai Negeri Sipil dan Pejabat Negara.</span></span></span></span></p>\r\n', '<p style="margin-left:0.25in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Beberapa kejadian dan kegiatan penting </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">sampai periode 31 Desember 2021 </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">adalah sebagai berikut: </span></span></span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;&nbsp;<strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Pertumbuhan </span></span></strong><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Total Aset dan Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara</span></span></strong></span></span>\r\n\r\n		<ol style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span></span></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada 31 Desember 2021 <em>(Audited)</em> sebesar Rp189.832.340.793.717,- Jika&nbsp; </span></span></span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; dibandingkan dengan kondisi 31 Desember 2020 <em>(Audited) </em>mengalami &nbsp;pertumbuhan sebesar Rp18.106.375.726.609,- atau naik 10,54%.</span></span></span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Aset tersebut terdiri dari ;</span></span></span></span></p>\r\n\r\n<ul>\r\n	<li style="list-style-type:none">\r\n	<ul>\r\n		<li style="list-style-type:none">\r\n		<ul>\r\n			<li style="list-style-type:none">\r\n			<ul style="list-style-type:disc">\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;Aset Investasi sebesar Rp180.022.728.373.743,- meningkat sebesar Rp18.276.102.993.582,- atau&nbsp;&nbsp;&nbsp; </span></span></span></span> <span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">naik sebesar 11,30% bila dibandingkan dengan 31 Desember 2020 <em>(Audited)</em>; </span></span></span></span></li>\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;Aset Bukan Investasi sebesar Rp9.809.612.419.974,- mengalami penurunan sebesar Rp169.727.266.973,- atau turun 1,70% bila &nbsp;dibandingkan dengan 31 Desember 2020 <em>(Audited)</em>.</span></span></span></span></li>\r\n			</ul>\r\n			</li>\r\n		</ul>\r\n		</li>\r\n	</ul>\r\n	</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="list-style-type:none">\r\n		<ol start="2" style="list-style-type:lower-alpha">\r\n			<li><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;<span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Total Kewajiban &nbsp;</span></span></span></span></li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada 31 Desember 2021 <em>(Audited)</em> sebesar Rp192.822.962.471,- atau </span></span></span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; mengalami penurunan sebesar Rp87.399.069.110,- &nbsp;atau turun 31,19% jika dibandingkan dengan 31 Desember 2020 <em>(Audited)</em>.</span></span></span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="list-style-type:none">\r\n		<ol start="3" style="list-style-type:lower-alpha">\r\n			<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;Sedangkan pencapaian Total Dana Bersih yang merupakan selisih dari Total Aset dan Total Kewajiban pada 31 Desember 2021 <em>(Audited)</em> adalah sebesar Rp189.639.517.831.246,- atau naik sebesar Rp18.193.774.795.719,- atau mengalami pertumbuhan sebesar 10,61%.</span></span></span></span></li>\r\n		</ol>\r\n		</li>\r\n		<li style="list-style-type:none">2) <span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Peningkatan Pelayanan</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">a) Upaya yang Telah dan Sedang Dilakukan untuk Meningkatkan Kualitas Pelayanan</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Upaya-upaya yang telah dan sedang dilakukan guna meningkatkan kualitas dan perluasan pelayanan kepada peserta adalah dengan pengembangan <em>Delighted Customer Services </em>(DCS) dalam bentuk <em>high quality services</em> diantaranya melalui Layanan Klaim Otomatis, <em>E-Channel Delivery Services</em> dan TASPEN PESONA &ldquo;Tanggap Andal Selamatkan Pensiunan dengan Pelayanan Bebas Corona&rdquo; melalui layanan <em>e-klaim</em> TASPEN, TASPEN <em>Care</em>, dan aplikasi TASPEN Otentikasi.</span></span></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">b) Sosialisasi KeTASPENan</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Sosialisasi dilakukan melalui berbagai media, yaitu media cetak dan media online. Saat ini TASPEN juga memaksimalkan penggunaan media sosial dalam melakukan sosialisasi, diantaranya sosialisasi TASPEN PESONA, TASPEN Mobile, TASPEN otentikasi dan lainnya.</span></span></span></span></li>\r\n		<li style="list-style-type:none">c) <span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Penyelesaian Keluhan Pelanggan</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none">Untuk Penyelesaian Keluhan Pelanggan Januari sd Desember 2021 terkait Penipuan, Pembayaran, Persyaratan, Kepesertaan, Alamat, Klaim, Mutasi, dan lain lain telah ditindaklanjuti dengan persentase 100%.</li>\r\n		<li style="list-style-type:none">d) <span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Press Realease</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Pelaksanaan Press Release yang dilaksanakan sampai dengan 31 Desember 2021 diantaranya adalah meraih penghargaan The Best Brand Image in Mandatory Insurance Category, bersama dengan Pemkab Pasaman Barat Bersinergi Tingkatkan Kesejahteraan Karyawan Non-ASN dan Non-PPPK, menyerahkan bantuan Mobil Ambulans Multifungsi Kepada Kementerian BUMN, bersinergi dengan Negara-Negara di Asia Terkait Pengelolaan ASN menyerahkan 4 Unit Ambulans, menerima Anugerah KORPRI Award 2021, Salurkan Bantuan kepada Korban Erupsi Gunung Semeru, MENPAN-RB Resmikan TASPEN Mal Pelayanan Publik Di Kabupaten Bandung, menyalurkan bantuan Digitalisasi Pendidikan di Tangerang dan Rp110 Juta kepada Korban Erupsi Gunung Semeru.</span></span></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">e) Peningkatan Validasi dan Akurasi Data</span></span></strong></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Dalam rangka meningkatkan competitive advantage guna optimalisasi manajemen data peserta, PT TASPEN (Persero) melakukan upaya-upaya sebagai berikut :</span></span></span></span></li>\r\n		<li style="list-style-type:none">(1) <span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Rekonsiliasi data peserta aktif dan penerimaan iuran dilakukan setiap bulan (Internal Pra Rekonsiliasi), rekonsiliasi dengan instansi peserta dilakukan minimal 1 kali dalam satu tahun. Validasi Data Peserta Aktif periode 31 Desember 2021 mencapai 99,62%.</span></span></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">(2) Validasi Data Pensiun sampai dengan 31 Desember 2021 mencapai 99,99%.</span></span></span></span></li>\r\n		<li style="list-style-type:none"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">(3) Akurasi Data PNS Pusat dan PNS Daerah sampai dengan </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">31 Desember 2021</span></span> <span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">mencapai 99,97%.</span></span></li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Laporan </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Tahun 2021 <em>(Audited)</em> </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Akumulasi Iuran Pensiun PNS dan Pejabat Negara ini merupakan informasi mengenai PT T</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">ASPEN</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif"> (Persero) dan penjabaran laporan kegiatan yang memuat aspek-aspek operasional, keuangan, investasi </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">dan operasional pembayaran belanja pensiun Anggaran Pendapatan dan Belanja Negara (APBN) periode 01 Januari 2021 sampai dengan 31 Desember 2021.</span></span></span></span></p>\r\n', '', '<ol style="list-style-type:lower-alpha">\r\n	<li style="text-align:justify"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Direktur Utama&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">: </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">A.N.S. Kosasih&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SK-23/MBU/01/2020</span></span></span></span></li>\r\n	<li style="text-align:justify"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Direktur Operasional&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span></span> <span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Mohamad Jufri&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SK-23/MBU/01/2020</span></span></span></span></li>\r\n	<li style="text-align:justify"><span style="font-size:12pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Direktur </span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Keuangan</span></span><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :</span></span> <span 