	(2, 'TSN002', 2021, '<p style="margin-left:0in; margin-right:0in"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara Tahun 2021 (<em><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Audited)</span></em> ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan pasal 8 Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor : 243/PMK.02/2016 tanggal 30 Desember 2016.Laporan Akumulasi Iuran Pensiun PNS dan Pejabat Negara Tahun 2021 (<em><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Audited)</span></em> ini disampaikan kepada Menteri Keuangan RI c.q Direktur Jenderal Anggaran Kementerian Keuangan RI, sesuai dengan pasal 8 Peraturan Menteri Keuangan Nomor: 169/PMK.02/2019 tanggal 20 November 2019 tentang Pelaporan Pengelolaan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara, sebagai pengganti dan mencabut Peraturan Menteri Keuangan sebelumnya Nomor : 243/PMK.02/2016 tanggal 30 Desember 2016.</span></span></span></span></p>\r\n', '<p style="margin-left:0in; margin-right:0in"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Guna memenuhi kewajiban sebagai Badan Penyelenggara Dana Iuran Pegawai Negeri Sipil dan Pejabat Negara, maka PT TASPEN (Persero) diwajibkan untuk menyampaikan Laporan Akumulasi Iuran Pensiun Pegawai Negeri Sipil dan Pejabat Negara Tahun 2021</span></span> <em><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">(Audited)</span></span></em> <span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">dalam rangka pengawasan atas pengadministrasian penitipan dana yang berasal dari iuran pensiun Pegawai Negeri Sipil dan Pejabat Negara.</span></span></span></span></p>\r\n', '<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Beberapa kejadian dan kegiatan penting sampai periode 31 Desember 2021 adalah sebagai berikut: </span></span></span></span></p>\r\n\r\n<ol>\r\n	<li style="list-style-type:none">\r\n	<ol>\r\n		<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Pertumbuhan Total Aset dan Kewajiban Akumulasi Iuran Pensiun PNS dan Pejabat Negara</span></span></strong></span></span>\r\n\r\n		<ol>\r\n			<li style="list-style-type:none">\r\n			<ol style="list-style-type:lower-alpha">\r\n				<li style="text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara </span></span></span></span></li>\r\n			</ol>\r\n			</li>\r\n		</ol>\r\n		</li>\r\n	</ol>\r\n	</li>\r\n</ol>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Aset Akumulasi Iuran Pensiun PNS dan Pejabat Negara pada 31 Desember 2021 <em>(Audited)</em> sebesar Rp189.832.340.793.717,- </span></span></span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jika&nbsp;dibandingkan dengan kondisi 31 Desember 2020 <em>(Audited) </em>mengalami &nbsp;pertumbuhan sebesar Rp18.106.375.726.609,- atau </span></span></span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; naik 10,54%.</span></span></span></span></p>\r\n\r\n<p style="margin-left:0in; margin-right:0in; text-align:justify"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Total Aset tersebut terdiri dari ;</span></span></span></span></p>\r\n\r\n<ul>\r\n	<li><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Aset Investasi sebesar Rp180.022.728.373.743,- meningkat sebesar Rp18.276