10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Sosialisasi dilakukan melalui berbagai media, yaitu media cetak dan media online. Saat ini TASPEN juga memaksimalkan penggunaan media sosial dalam melakukan sosialisasi, diantaranya sosialisasi TASPEN PESONA, TASPEN Mobile, TASPEN otentikasi dan lainnya.</span></span></span></span></p>\r\n\r\n<p style="list-style-type:none">c) <span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Penyelesaian Keluhan Pelanggan</span></span></strong></span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:12.0pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Untuk Penyelesaian Keluhan Pelanggan Januari sd Desember 2021 terkait Penipuan, Pembayaran, Persyaratan, Kepesertaan, Alamat, Klaim, Mutasi, dan lain lain telah ditindaklanjuti dengan persentase 100%.</span></span></span></span></p>\r\n\r\n<p style="list-style-type:none">d) <span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><strong><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Press Realease</span></span></strong></span></span></p>\r\n\r\n<p style="margin-left:0.5in; margin-right:0in"><span style="font-size:11pt"><span style="font-family:&quot;Calibri&quot;,sans-serif"><span style="font-size:10.0pt"><span style="font-family:&quot;Trebuchet MS&quot;,sans-serif">Pelaksanaan Press Release yang dilaksanakan sampai dengan 31 Desember 2021 diantaranya adalah meraih penghargaan The Best Brand Image in Mandatory Insurance Category, bersama dengan Pemkab Pasaman Barat Bersinergi Tingkatkan Kesejahteraan Karyawan Non-ASN dan Non-PPPK, menyerahkan bantuan Mobil Ambulans Multifungsi Kepada Kementerian BUMN, bersinergi dengan 